openapi: 3.0.0
info:
  version: '0.1.0'
  title: 'IncQuery Massif Wrapper REST API'
  description: 'Massif Wrapper REST API'
servers:
- url: /massifwrapper
paths:
  /loadMDL:
    post:
      summary: Loads an .mdl model to MATLAB via massif and transforms it to .simulink (EMF)
      operationId: loadMDL
      tags:
      - Massif
      requestBody:
        description: The plain text representation of the .mdl file to be transformed to EMF.
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ModelLoadSchema'
      responses:
        '200':
          $ref: '#/components/responses/ModelTransformationResult'
        default:
          $ref: '#/components/responses/UnexpectedError'
  /loadEMF:
    post:
      summary:  Loads a .simulink (EMF) model to MATLAB via massif and transforms it to .mdl
      operationId: loadEMF
      tags:
      - Massif
      requestBody:
        description: The plain text representation of the EMF file to be transformed to .simulink.
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ModelExportSchema'
      responses:
        '200':
          $ref: '#/components/responses/ModelTransformationResult'
        default:
          $ref: '#/components/responses/UnexpectedError'
  /fetch:
    get:
      summary: Returns the loaded model as EMF
      operationId: fetch
      tags:
      - MATLAB
      responses:
        '200':
          $ref: '#/components/responses/ModelTransformationResult'
        default:
          $ref: '#/components/responses/UnexpectedError'
  /runscript:
    post:
      summary: Runs a specified matlab script
      operationId: runscript
      tags:
      - MATLAB
      requestBody:
        description: The plain text representation of the script to be run in matlab.
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/ScriptSchema'
      responses:
        '200':
          $ref: '#/components/responses/ScriptExecuted'
        default:
          $ref: '#/components/responses/UnexpectedError'
  /runcommand:
    post:
      summary: Runs command on the imported model
      operationId: runcommand
      tags:
      - MATLAB
      requestBody:
        description: Runs a command with the specified parameteres
        required: true
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/CommandSchema'
      responses:
        '200':
          $ref: '#/components/responses/CommandExecuted'
        default:
          $ref: '#/components/responses/UnexpectedError'
  /status:
    get:
      summary: Retrieve actual status of the Matlab-Wrapper Server
      operationId: serverStatus
      tags:
      - Server Management
      responses:
        '200':
          description: Server state - UP
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ServerStatusResponse'
        '500':
          description: Server state - Down
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ServerStatusResponse'
        default:
          $ref: '#/components/responses/UnexpectedError'
components:
  responses:
    UnexpectedError:
      description: Unexpected error
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/Error'
    ModelTransformationResult:
      description: Model transformation was successful
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/ModelResponse'
    ScriptExecuted:
      description: Script has finished running
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/ScriptResponse'
    CommandExecuted:
      description: Command has finished running
      content:
        application/json:
          schema:
            $ref: '#/components/schemas/CommandResponse'
  schemas:
    ModelLoadSchema:
      required:
      - model
      properties:
        model:
          type: string
          example: "Model {\r\n  Name\t\t\t  \"sldemo_clutch_importer_example\"\r\n  Version\t\t  7.9\r\n  MdlSubVersion\t\t  0\r\n  GraphicalInterface {\r\n    NumRootInports\t    0\r\n    NumRootOutports\t    8\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"EngineSpeed\"\r\n      Name\t\t      \"we\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"VehicleSpeed\"\r\n      Name\t\t      \"wv\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"ShaftSpeed\"\r\n      Name\t\t      \"w\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"LockedFlag\"\r\n      Name\t\t      \"Locked Flag\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"LockupFlag\"\r\n      Name\t\t      \"Lockup Flag\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"UnlockFlag\"\r\n      Name\t\t      \"Break-Apart Flag\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      Name\t\t      \"FrictionTorque Required for Lockup\"\r\n    }\r\n    Outport {\r\n      BusObject\t\t      \"\"\r\n      BusOutputAsStruct\t      \"off\"\r\n      SignalName\t      \"Tfmaxs\"\r\n      Name\t\t      \"Max Static Friction Torque\"\r\n    }\r\n    ParameterArgumentNames  \"\"\r\n    ComputedModelVersion    \"1.44\"\r\n    NumModelReferences\t    0\r\n    NumTestPointedSignals   10\r\n    TestPointedSignal {\r\n      SignalName\t      \"Fn\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Clutch Pedal\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"Tin\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Engine Torque\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"Tfmaxk\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Friction Model\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"Tfmaxs\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Friction Model\"\r\n      PortIndex\t\t      2\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"LockedFlag\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Friction Mode Logic\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"LockupFlag\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Friction Mode Logic\"\r\n      PortIndex\t\t      2\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"UnlockFlag\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Friction Mode Logic\"\r\n      PortIndex\t\t      3\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"ShaftSpeed\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Locked\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"EngineSpeed\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Unlocked\"\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n    TestPointedSignal {\r\n      SignalName\t      \"VehicleSpeed\"\r\n      FullBlockPath\t      \"sldemo_clutch_importer_example/Unlocked\"\r\n      PortIndex\t\t      2\r\n      LogSignal\t\t      1\r\n      MaxPoints\t\t      5000\r\n      Decimation\t      2\r\n    }\r\n  }\r\n  Description\t\t  \"Building a Clutch Lock-Up Model\\n \\nThis example demonstrates the use of Simulink(R) to model and si\"\r\n  \"mulate a\\nrotating clutch system. Although modeling a clutch system is difficult\\nbecause of topological changes in \"\r\n  \"the system dynamics during lockup, this\\nexample shows how Simulinks enabled subsystems feature easily handles\\nsuch\"\r\n  \" problems. We illustrate how to employ important Simulink modeling\\nconcepts in the creation of the clutch simulatio\"\r\n  \"n. Designers can apply\\nthese concepts to many models with strong discontinuities and constraints\\nthat may change d\"\r\n  \"ynamically. \\n\\nIn the demonstration, we use enabled subsystems to build the clutch\\nmodel. Two enabled subsystems m\"\r\n  \"odel the clutch dynamics in either the\\nlocked or unlocked position. After running the simulation, a GUI opens.\\nChe\"\r\n  \"cking any of the boxes on the GUI produces a plot of any of the\\nselected variables (versus time).  \\n\"\r\n  SavedCharacterEncoding  \"windows-1250\"\r\n  PostLoadFcn\t\t  \"sldemo_clutchplot\"\r\n  SaveDefaultBlockParams  on\r\n  ScopeRefreshTime\t  0.035000\r\n  OverrideScopeRefreshTime on\r\n  DisableAllScopes\t  off\r\n  DataTypeOverride\t  \"UseLocalSettings\"\r\n  DataTypeOverrideAppliesTo \"AllNumericTypes\"\r\n  MinMaxOverflowLogging\t  \"UseLocalSettings\"\r\n  MinMaxOverflowArchiveMode \"Overwrite\"\r\n  FPTRunName\t\t  \"Run 1\"\r\n  MaxMDLFileLineLength\t  120\r\n  CloseFcn\t\t  \"sldemo_clutchplot Close\"\r\n  StartFcn\t\t  \"sldemo_clutchplot Start\"\r\n  StopFcn\t\t  \"if exist ('sldemo_clutch_output')\\n   sldemo_clutchplot Stop\\nend\"\r\n  Created\t\t  \"Wed Aug 19 15:51:31 1998\"\r\n  Creator\t\t  \"The MathWorks Inc.\"\r\n  UpdateHistory\t\t  \"UpdateHistoryNever\"\r\n  ModifiedByFormat\t  \"%<Auto>\"\r\n  LastModifiedBy\t  \"transima\"\r\n  ModifiedDateFormat\t  \"%<Auto>\"\r\n  LastModifiedDate\t  \"Wed Nov 12 00:17:08 2014\"\r\n  RTWModifiedTimeStamp\t  247039780\r\n  ModelVersionFormat\t  \"1.%<AutoIncrement:44>\"\r\n  ConfigurationManager\t  \"none\"\r\n  SampleTimeColors\t  off\r\n  SampleTimeAnnotations\t  off\r\n  LibraryLinkDisplay\t  \"none\"\r\n  WideLines\t\t  on\r\n  ShowLineDimensions\t  off\r\n  ShowPortDataTypes\t  off\r\n  ShowDesignRanges\t  off\r\n  ShowLoopsOnError\t  on\r\n  IgnoreBidirectionalLines off\r\n  ShowStorageClass\t  off\r\n  ShowTestPointIcons\t  on\r\n  ShowSignalResolutionIcons on\r\n  ShowViewerIcons\t  on\r\n  SortedOrder\t\t  off\r\n  ExecutionContextIcon\t  off\r\n  ShowLinearizationAnnotations on\r\n  BlockNameDataTip\t  off\r\n  BlockParametersDataTip  on\r\n  BlockDescriptionStringDataTip\toff\r\n  ToolBar\t\t  on\r\n  StatusBar\t\t  on\r\n  BrowserShowLibraryLinks off\r\n  BrowserLookUnderMasks\t  off\r\n  SimulationMode\t  \"normal\"\r\n  LinearizationMsg\t  \"none\"\r\n  Profile\t\t  off\r\n  ParamWorkspaceSource\t  \"MATLABWorkspace\"\r\n  AccelSystemTargetFile\t  \"accel.tlc\"\r\n  AccelTemplateMakefile\t  \"accel_default_tmf\"\r\n  AccelMakeCommand\t  \"make_rtw\"\r\n  TryForcingSFcnDF\t  off\r\n  RecordCoverage\t  off\r\n  CovPath\t\t  \"/\"\r\n  CovSaveName\t\t  \"covdata\"\r\n  CovMetricSettings\t  \"d\"\r\n  CovNameIncrementing\t  off\r\n  CovHtmlReporting\t  on\r\n  CovForceBlockReductionOff on\r\n  covSaveCumulativeToWorkspaceVar on\r\n  CovSaveSingleToWorkspaceVar on\r\n  CovCumulativeVarName\t  \"covCumulativeData\"\r\n  CovCumulativeReport\t  off\r\n  CovReportOnPause\t  on\r\n  CovModelRefEnable\t  \"Off\"\r\n  CovExternalEMLEnable\t  off\r\n  ExtModeBatchMode\t  off\r\n  ExtModeEnable